import React from 'react';

export default function Input(){
    return(
        <main>
            <h1 className = "main-title">Input</h1>
            <ul className = "main-container">
                <h3>For each of the following, select the scale that best represents you:</h3>
                <Question/>
            </ul>
        </main>
    )
}

function Question()
{
    const index = 1;
    const question = "Depressed Mood (sadness, hopeless, helpless, worthless)";
    const min = 0;
    const max = 100;

    return(
        <div>
            <h2>{index}. {question}</h2>
            <input type = "range" min = {min} max = "max" value = {(max-min)/2} class = "slider" id = "q1"></input>
        </div>
    )
}
